import React from "react";
import { Link } from 'react-router-dom';


function ArtistsCard(props) {
    return (
        <div class="card  artist-card p-2 border-0">

            <div class="d-flex justify-content-center mt-2">
                <img class="card-img-top circle-image" src={props.image_url} alt="artistsPic" />
            </div>

            <div class="card-body text-start d-flex flex-column">
                <a class =" artist-card-link artist-card-title" href="/artists/artistspage/12">{props.name}</a>
                <span><h1 class ="artist-card-text">#{props.popularity}</h1></span>
                <span><h1 class ="artist-card-text"><Link class="artist-card-link artist-card-genre"href="https://getbootstrap.com/docs/5.3/utilities/flex/#justify-content">{}}</Link></h1></span>
                <span><h1 class ="artist-card-text">Latest Album : props.albums[0]</h1></span>
            </div>

            <div class="card-body text-start d-flex flex-column">
                <h1  class ="artist-card-subtitle">Venues</h1>
                <span><a class="artist-card-link artist-card-text" href="https://getbootstrap.com/docs/5.3/utilities/flex/#justify-content">Austin,TX</a></span>
                <span><a class="artist-card-link artist-card-text" href="https://getbootstrap.com/docs/5.3/utilities/flex/#justify-content">NewJeresy, TX</a></span>
                <span><a class="artist-card-link artist-card-text"  href="https://getbootstrap.com/docs/5.3/utilities/flex/#justify-content">NYC, NY</a></span>
            </div>

        </div>
    );
}

export default ArtistsCard;
